declare function isWeakKey(value: unknown): value is WeakKey;
declare class SafeWeakSet extends WeakSet {
    has(value: unknown): boolean;
    add(value: unknown): this;
    delete(value: unknown): boolean;
}
declare class SafeWeakMap<T> extends WeakMap<WeakKey, T> {
    has(value: unknown): boolean;
    get(key: unknown): T | undefined;
    set(key: unknown, value: T): this;
    delete(value: unknown): boolean;
}

export { SafeWeakMap, SafeWeakSet, isWeakKey };
